To terminate a C program, you can use one of the following methods:

1. Using the `return` statement in the `main()` function:
   - The `main()` function is the entry point of a C program.
   - You can use the `return` statement to specify the exit status of the program.
   - Typically, returning 0 indicates successful termination, while non-zero values indicate an error or abnormal termination.
   Example:
   ```c
   int main() {
       // Program logic
       return 0;
   }
   ```

2. Using the `exit()` function:
   - The `exit()` function is defined in the `<stdlib.h>` header file.
   - You can call `exit()` from anywhere in your program to terminate it immediately.
   - The argument passed to `exit()` represents the exit status of the program.
   Example:
   ```c
   #include <stdlib.h>

   int main() {
       // Program logic
       exit(0);
   }
   ```

3. Reaching the end of the `main()` function:
   - If the `main()` function reaches the end without encountering a `return` statement, the program will automatically terminate.
   - In this case, the program's exit status is assumed to be 0 (successful termination).
   Example:
   ```c
   int main() {
       // Program logic
   }
   ```

It's important to note that when a program terminates, any resources it has allocated (such as memory, file handles, etc.) should be properly released before the program exits. This can be done by calling appropriate cleanup functions or using resource management techniques like `fclose()` for files or `free()` for dynamically allocated memory.

Additionally, if your program encounters an error condition from which it cannot recover, you can use the `abort()` function to terminate the program abnormally and generate a core dump (if supported by the system). However, this should be used sparingly and only in exceptional circumstances.

